import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  const user = JSON.parse(localStorage.getItem("user"));

  return (
    <div style={{ display: "flex", justifyContent: "center", gap: "20px", padding: "20px", background: "#1d2671", color: "white" }}>
      <Link to="/">Home</Link>
      {user?.role === "hirer" && <Link to="/freelancers">Freelancers</Link>}
      {user?.role === "hirer" && <Link to="/post-job">Post Job</Link>}
      {user?.role === "jobseeker" && <Link to="/jobs">Jobs</Link>}
      {user && <Link to="/messages">Messages</Link>}
      {!user && <Link to="/login">Login</Link>}
      {!user && <Link to="/register">Register</Link>}
    </div>
  );
}

export default Navbar;
